import React, { Component } from "react";


class EmpolyerItem extends Component{
        render(){
                return(
                    <div className="card rounded col-md-4 col-sm-6" style={{width: "18rem"}}>
                        <img src={this.props.img} className="card-img-top" alt={this.props.alt}/>
                        <div className="card-body">
                            <h5 className="card-title text-center">{this.props.name + " " + this.props.nick}</h5>
                            <p className="sub-title-card" style={{fontSize: "12px"}}>{this.props.role}</p>
                            <ul>
                                <li>{this.props.Email!=null? `Email: ${this.props.Email}` : null }</li>
                                <li>{this.props.mobile!=null? "Phone: " + this.props.mobile : null}</li>
                                <li>{this.props.website!=null? "Website: " + this.props.website : null}</li>
                            </ul>
                        </div>
                    </div>
                )
        }
} 

export default EmpolyerItem
